// Blog.js
import React from 'react';
import BlogEntry from './BlogEntry'; // Ensure correct path
import './Blog.css';

const Blog = () => {
  const entries = [
    {
      title: 'My First Blog Post',
      body: 'This is the body of my first blog post.',
      image: 'https://example.com/image1.jpg'
    },
    {
      title: 'Another Post',
      body: 'Here is some more content for another post.',
      image: 'https://example.com/image2.jpg'
    }
  ];

  return (
    <div className="blog">
      {entries.map((entry, index) => (
        <BlogEntry
          key={index}
          title={entry.title}
          body={entry.body}
          image={entry.image}
        />
      ))}
    </div>
  );
};

export default Blog;
